    false,nt"url": null,nt"notes": "The fields have been mowed annually for
    the past years; however, with time, woody vegetation including bayberry has become
    more prevalent. The Refuge staff would like to maintain these areas at an earlier
    successional stage to provide foraging areas for waterfowl and mammal species. Sample
    plots have been targeted for plowing, harrowing, and seeding instead of treating
    the entire fields, to enable close monitoring of management efforts and see "what
    works" for the specific area in terms of species planted, staff availability, and
    funding.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
